import React from "react";
import "../timeline/justForTestCss.css";
import firstLogoNew from "../images/firstLogoNew.png";
import creationofFizmasoftNew from "../images/creationofFizmasoftNew.png";
import presentationNew from "../images/presentationNew.png";
import realeseOfNew from "../images/realeseOfNew.png";
import releaseOfParentNew from "../images/releaseOfParentNew.png";
import safeCityNew from "../images/safeCityNew.png";

const JustForTest = () => {
  return (
    <div className="row container-fluid timeline-main-div d-flex justify-content-center">
      <div className="row" style={{ flexDirection: "column" }}>
        <div className="about-fizmasoft">
          <h5>
            Fizmasoft, Uzbek company offering <br></br>various IT services.
            Fizmasoft team was founded in Tashkent in 2013
          </h5>
        </div>
        <div>
          <img className="firstlogo" alt="Logo" src={firstLogoNew} />
        </div>
        <div>
          <img className="sherzodaka" alt="sherzod" src={realeseOfNew} />
        </div>
        <div>
          <img className=" parentcontrol" alt="Logo" src={releaseOfParentNew} />
        </div>
      </div>
      <div className="row" style={{ flexDirection: "column" }}>
        <div>
          <img className="azamaka" alt="Logo" src={creationofFizmasoftNew} />
        </div>
        <div>
          <img className="afterazamaka" alt="Logo" src={presentationNew} />
        </div>
        <div>
          <img className="safecity" alt="Logo" src={safeCityNew} />
        </div>
      </div>
    </div>
  );
};

export default JustForTest;
